    private static final Double TEST_LAT1 = 50.141706;
    private static final Double TEST_LON1 = 6.135864;
    private static final String TEST_LATLON1 = TEST_LAT1 + "," + TEST_LON1;

    private LocalTestServer server;

    @Before
    public void startServer() {
        server = new LocalTestServer("1.0", 8081);
        server.start();
    }

    @After
    public void stopServer() {
        server.stop();
    }

    @Test
    public void checkAlphabetsJson() {
        LOG.info("checkAlphabetsJson");
        final Response response = new ResteasyClientBuilder().build().
                target(server.url("/mapcode/alphabets")).
                request().
                accept(MediaType.APPLICATION_JSON_TYPE).get();
        Assert.assertNotNull(response);
        Assert.assertEquals(200, response.getStatus());
        final String s = response.readEntity(String.class);
        Assert.assertEquals("{\"total\":28,\"alphabets\":[{\"name\":\"ROMAN\"},{\"name\":\"GREEK\"},{\"name\":\"CYRILLIC\"},{\"name\":\"HEBREW\"},{\"name\":\"DEVANAGARI\"},{\"name\":\"MALAYALAM\"},{\"name\":\"GEORGIAN\"},{\"name\":\"KATAKANA\"},{\"name\":\"THAI\"},{\"name\":\"LAO\"},{\"name\":\"ARMENIAN\"},{\"name\":\"BENGALI\"},{\"name\":\"GURMUKHI\"},{\"name\":\"TIBETAN\"},{\"name\":\"ARABIC\"},{\"name\":\"KOREAN\"},{\"name\":\"BURMESE\"},{\"name\":\"KHMER\"},{\"name\":\"SINHALESE\"},{\"name\":\"THAANA\"},{\"name\":\"CHINESE\"},{\"name\":\"TIFINAGH\"},{\"name\":\"TAMIL\"},{\"name\":\"AMHARIC\"},{\"name\":\"TELUGU\"},{\"name\":\"ODIA\"},{\"name\":\"KANNADA\"},{\"name\":\"GUJARATI\"}]}",
                s);

        final AlphabetsDTO x = new Gson().fromJson(s, AlphabetsDTO.class);
        Assert.assertNotNull(x);
        Assert.assertEquals(28, x.getTotal());
        Assert.assertEquals("ROMAN", x.getAlphabets().get(0).getName());
    }

